from datetime import datetime

def parse_date(date_str):
    try:
        return datetime.strptime(date_str, '%b %d')
    except ValueError:
        try:
            return datetime.strptime(date_str, '%B %d')
        except ValueError:
            raise ValueError(f"Invalid date format: {date_str}")

start_day = 'May 1st'
end_day = 'May 5th'

start_date_obj = parse_date(start_day)
end_date_obj = parse_date(end_day)

iso_start_day = start_date_obj.strftime('%Y-%m-%d')
iso_end_day = end_date_obj.strftime('%Y-%m-%d')

print(f"ISO Start Day: {iso_start_day}")
print(f"ISO End Day: {iso_end_day}")
```
